  name: 'BadgeBase'
})

const wordContainerHeight = ref(0)


const getCoorWord = () => {
  const pathEl = document.getElementById('coor-word') as HTMLElement
  const { height } = pathEl.getBoundingClientRect()
  wordContainerHeight.value = height

} 

const startYPosition = computed(() =>{
  if (props.word.length === 2) return 105
  if (props.word.length === 3) return 100
  if (props.word.length === 4) return 93
  return 100
})

onMounted(() => getCoorWord())

watchEffect(() => {

  window.addEventListener('resize scroll', getCoorWord);

  return () => {
